import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'

import LandingPage from './components/LandingPage'

export default class App extends React.Component {
    render(){
        return (
          <Router>
            <Switch>
              <Route exact path="/">
                <LandingPage />
              </Route>
            </Switch>
          </Router>
        );
    }
}
